import React from 'react';
import './ReviewItem.css'

const ReviewItem = ({ product }) => {
    const { name, price, quantity, img } = product;
    return (
        <div className='reviewItem'>
            <img src={img} alt="" />
            <div>
                <h2>{name}</h2>
                <p>Price : {price}$</p>
                <p>Quantity : {quantity}</p>
            </div>
        </div>
    );
};

export default ReviewItem;
